import React from "react";

const Articles = props => (
  <div>
    {props.articles.map(article => {
      return (
        <div key={article.title}>
          <img src={article.urlToImage} alt={article.title} />
          <p>{article.title}</p>
        </div>
      );
    })}
  </div>
);

export default Articles;
